import React, {Component, Fragment} from 'react';
import './type.css';
import store from './store';
class Types extends Component{
    constructor(props){
        super(props);
        this.state = {};
        this.handleClickChange = this.handleClickChange.bind(this);
    }

    render(){
        return(
            <Fragment>
                <div>
                <div><span>{this.props.type_name}</span><button onClick={this.handleClickChange(this.props.type_name)}>点击</button></div>
                {this.state[this.props.type_name]?this.state[this.props.type_name].map((value)=>{
                        return (
                            <div key={value._uid} id="produces">
                                <div id="simple_info">
                                    <span id="produces_name">{value.ig_handle}</span>
                                    <span id="produces_date">{value.date}</span>
                                </div>
                            </div>
                        )
                    }):<div></div>
                }
                </div>
            </Fragment>
        )
    }
    handleClickChange(key){
        const action = {
            type: "changeChoice",
            value: key
        }
        store.dispatch(action)
    }
}
export default Types;
